import achiev from '../../assets/icons/Achievements.svg'
import categ from '../../assets/icons/Category.svg'
import team from '../../assets/icons/Team.svg'
import info from '../../assets/icons/Info.svg'
import face from '../../assets/icons/face.svg'
import {ReactNode} from "react";

type Props = {
    children?: ReactNode;
}
export const MainLayout: React.FC<Props> = ({children}) => {
    return (
        <div className={'bg-white w-screen h-full flex min-h-screen'}>
            <div className={'w-24 h-full grid justify-items-center'}>
                <img className={'rounded-full w-32 h-32'} src={face}/>
                <div>
                    <img className={'w-8 h-8'} src={achiev}/>
                    <img src={categ}/>
                    <img src={team}/>
                    <img src={info}/>
                </div>

            </div>
            {children}
        </div>
    );
};
